function PageReady(){const s="SettingCss";co.Form.set(s,(function(){const e=co.Form.getJson(s);co.sweet.confirm("是否確認儲存?","即將將您設定的css發佈在前台所有網站上!","確認","取消",(function(){co.WebSite.SettingCss(e.Css).done((function(s){s.success?co.sweet.success("儲存成功!"):co.sweet.error("失敗",s.error)}))}))})),co.WebSite.LoadFrameCss().done((function(s){co.Form.insertData({Css:s.message})}))}